import { useState } from "react"
import { useParams } from "react-router-dom"

function Forms(props) {
   const [value , setValue] = useState( { id: '', name: '', roll: '', schoolName: '' },)
    const params = useParams()
    
    const filterdStData = props.data.filter((item) => {
        return item.id === params.id
    })

    const formSubmit = (e) => {
        e.preventDefault()
    }

    const onchangeHandller =(val)=>{
        console.log(val.target.name);
    }

    return (
        <div>
            <form onSubmit={formSubmit}>
                <h3> Correction Form ID: </h3>
                <input name='name' value={value.name} placeholder="name" onChange={onchangeHandller}/>
                <input name='roll' placeholder="roll" onChange={onchangeHandller}/>
                <input name='schoolName' placeholder="schoolName" onChange={onchangeHandller}/>
                <button>Submit-Form</button>
            </form>
        </div>
    )
}
export default Forms
